--SQL SELECT statements
--How many games were played by University of Maryland over the years?
SELECT YEAR(g.gmeDate) AS 'GameYear', 
	   COUNT(g.gmeId) AS 'Number of Games'
FROM [Baseball.Game] g
GROUP BY YEAR(g.gmeDate)
ORDER BY YEAR(g.gmeDate);


--How many games did University of Maryland play away from their home ground?
SELECT loc.locName AS LocationName,
       COUNT(*) AS 'Number of Games'     
FROM [Baseball.Game] gme, 
     [Baseball.Play] ply, 
	 [Baseball.Location] loc
WHERE gme.gmeId = ply.gmeId
  AND ply.locId = loc.locId
  AND gme.gmeType = 'Away'
GROUP BY loc.locName


--What is UMDs Away Game Winning Percentage?
SELECT YEAR(gme.gmeDate) AS GameYear,
	   COUNT(*) AS TotalAwayGames,
	   SUM(CASE WHEN gme.gmeWin > gme.gmeLoss THEN 1 ELSE 0 END) AS AwayWins,
       (SUM(CASE WHEN gme.gmeWin > gme.gmeLoss THEN 1 ELSE 0 END) * 100) / COUNT(*) AS 'Winning Percentage'
FROM [Baseball.Game] gme
WHERE gme.gmeType = 'Away'
GROUP BY YEAR(gme.gmeDate)
ORDER BY GameYear;


--Who were UMDs Toughest BIG10 Opponents From 2015-2022?
SELECT opp.oppName AS OpponentName,
	   (SUM(CASE WHEN gme.gmeWin < gme.gmeLoss THEN 1 ELSE 0 END) * 100) / COUNT(*) AS 'Losing Percentage'
FROM [Baseball.Opponent] opp, 
	 [Baseball.Belong] bel, 
	 [Baseball.Game] gme
WHERE opp.oppId = bel.oppId
AND gme.gmeId = bel.gmeId
AND oppName IN ('Rutgers','Iowa','Illinois',
				'Michigan','Penn State','Purdue',
				'Northwestern','Indiana','Nebraska',
				'Ohio State','MichiganState','Minnesota')
AND gme.gmeDate BETWEEN '2015-01-01' AND '2022-12-31'
GROUP BY opp.oppName
ORDER BY 'Losing Percentage' DESC;